function retrieveData(){document.getElementById("nameDataShown").innerText=sessionStorage.getItem("Name"),document.getElementById("emailDataShown").innerText=sessionStorage.getItem("Email"),document.getElementById("typeDataShown").innerText=sessionStorage.getItem("Type"),document.getElementById("subjectDataShown").innerText=sessionStorage.getItem("Subject"),document.getElementById("messageDataShown").innerText=sessionStorage.getItem("Message")}window.addEventListener("DOMContentLoaded",retrieveData());
